      <Box display="flex" justifyContent="center" height={'inherit'}>
	  	<Toolbar sx={{width: '70%', justifyContent: "space-between"}}>
          <div style={{display: 'flex', flexDirection: 'column'}}>
          <Typography variant="p" align="left" sx={{fontSize: '0.8em', fontFamily: 'var(--font-family-ibm-plex-mono)', paddingBottom:'10px'}}>
            Built in React Â© Nelson Rodriguez 2024
          </Typography>
          <Typography sx={{fontSize: '0.8em'}}>email me @neroxv1313@gmail.com</Typography>
          </div>
          <Box sx={{ display: 'flex', width: '30%', justifyContent: 'center'}}>
                <NavbarSmall/>
          </Box>
      </Toolbar>

      </Box>
    </AppBar>
  );
};

export default Footer;
